DELIMITER //
CREATE PROCEDURE `fill_bezettingsdata_alle_kwartieren`(IN `dateStart` DATETIME, IN `dateEnd` DATETIME)
    NO SQL
BEGIN
  DROP TABLE IF EXISTS bezettingsdata_alle_kwartieren;
  CREATE TABLE IF NOT EXISTS `bezettingsdata_alle_kwartieren` (`timestamp` datetime NOT NULL) ENGINE=MEMORY DEFAULT CHARSET=latin1;

  ALTER TABLE `bezettingsdata_alle_kwartieren` ADD PRIMARY KEY (`timestamp`);

  WHILE dateStart <= dateEnd DO
    SET dateStart = date_add(dateStart, INTERVAL 15 MINUTE);
  END WHILE;
END//
DELIMITER ;

