-- Structuur van  functie veiligstallen_test.getOccupation wordt geschreven
DELIMITER //
CREATE FUNCTION `getOccupation`(`sectionID` VARCHAR(13), `date` DATETIME) RETURNS int(11) unsigned zerofill
    READS SQL DATA
    COMMENT 'Berekent bezetting van gegeven sectie op gegeven moment'
BEGIN DECLARE total INT(11); SELECT count(*) INTO total FROM `transacties` WHERE sectieID = sectionID AND Date_checkin <= date AND Date_checkout > date AND Type_checkin != 'sync' AND Type_checkout != 'sync'; RETURN total; END//
DELIMITER ;

-- Structuur van  functie veiligstallen_test.getOccupation_from_bezettingsdata wordt geschreven
DELIMITER //
CREATE FUNCTION `getOccupation_from_bezettingsdata`(`_sectionID` VARCHAR(13), `_timestamp` TIMESTAMP, `_source` VARCHAR(20)) RETURNS int(11)
    NO SQL
BEGIN 
DECLARE occ INT(11); 


SELECT occupation INTO occ 
FROM `bezettingsdata` 
WHERE sectionID = _sectionID 
AND `timestamp` <= _timestamp 
AND occupation IS NOT NULL
AND `source` = _source
ORDER BY `timestamp` DESC 
LIMIT 1;

RETURN COALESCE(occ, 0); 

END//
DELIMITER ;

