-- Structuur van  procedure veiligstallen_test.updateBezettingsdata_occupation_externalsource wordt geschreven
DELIMITER //
CREATE PROCEDURE `updateBezettingsdata_occupation_externalsource`(IN `_sectionID` VARCHAR(13), IN `_date` TIMESTAMP, IN `_source` VARCHAR(20))
    NO SQL
BEGIN
UPDATE bezettingsdata
SET occupation = getOccupation_from_bezettingsdata(_sectionID, `timestamp`, _source)

WHERE bezettingsdata.`sectionID` = _sectionID
AND bezettingsdata.`timestamp` >= _date
AND bezettingsdata.`source` = _source
AND bezettingsdata.occupation IS NULL;

END//
DELIMITER ;

-- Structuur van  procedure veiligstallen_test.updateBezettingsdata_occupation_no_biketype wordt geschreven
DELIMITER //
CREATE PROCEDURE `updateBezettingsdata_occupation_no_biketype`(IN `_sectionID` VARCHAR(13), IN `startvalue` INT, IN `_date` TIMESTAMP, IN `_interval` INT)
BEGIN
SET @b := startvalue;
UPDATE bezettingsdata
SET occupation = (@b :=  checkins - checkouts + @b)
WHERE `sectionID` = _sectionID
AND `timestamp` >= _date
AND `interval` = _interval
AND `source` = 'FMS'
ORDER BY timestamp;

END//
DELIMITER ;

