	('0EA3BE48-E743-4991-A3B71A25585C1902', 'Machtiging buurtstallingen', '<h1>Machtigingsformulier fietsparkeerplaats in een buurtstalling/fietstrommel/-kluis</h1>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Ondergetekende,</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table id="naw">\r\n	<tbody>\r\n		<tr>\r\n			<td>Naam en voorletters:</td>\r\n			<td>{account.achternaam}, {account.voornaam} {account.tussenvoegsels}</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Adres:</td>\r\n			<td>{account.adres}</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Postcode en woonplaats:</td>\r\n			<td>{account.postcode} {account.plaats}</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Telefoonnummer:</td>\r\n			<td>{account.telefoon}</td>\r\n		</tr>\r\n		<tr>\r\n			<td>E-mailadres:</td>\r\n			<td>{account.email}</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="vertical-align:top;">Banknummer (IBAN):</td>\r\n			<td>________________________________ (kopie bankpas als bijlage toevoegen)</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="vertical-align:top;">Legitimatie &amp;- nummer:</td>\r\n			<td>Paspoort / ID-kaart <span style="font-size: 70%;">(1)</span> ________________________________ (kopie legitimatie als bijlage toevoegen)</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><br />\r\nverleent U-stal Holding B.V. een machtiging om namens de gemeente Utrecht:<br />\r\n&nbsp;</p>\r\n\r\n<ul>\r\n	<li>jaarlijks het verschuldigde bedrag voor het abonnement &#39;<cfif vMyISAM bles.subscriptiontypeexists="">{abonnement.type}&#39;</cfif> te gebruiken in {stalling.type} {stalling.naam} <cfif vMyISAM bles.subscriptiontypeexists="">(&euro; {abonnement.prijs})</cfif></li>\r\n	<li>eenmalig het borggeld voor toegangssleutel en penning (&euro; 18,85 + &euro; 1,15) af te schrijven van zijn bankrekening</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div style="width: 5cm;float:left;margin-right: 1cm;">\r\n<div>Handtekening aanvrager</div>\r\n\r\n<div style="padding-top: 2cm;">___________________________</div>\r\n</div>\r\n\r\n<div style="width: 4cm;float:left;">\r\n<div>datum</div>\r\n\r\n<div style="padding-top: 2cm;">____ - ____ - 20____</div>\r\n</div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style="clear:both;margin-top: 2cm;">DIT FORMULIER INGEVULD EN ONDERTEKEND MEEBRENGEN NAAR:<br />\r\nU-Stal Holding B.V.<br />\r\nKanaalweg 50<br />\r\n3526 KM Utrecht</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>In te vullen door U-stal Holding BV:</p>\r\n\r\n<table style="border-collapse: collapse;width:100%;">\r\n	<tbody>\r\n		<tr>\r\n			<td style="border: 1px solid black;padding: 5px;">Banknr. check</td>\r\n			<td style="border: 1px solid black;padding: 5px;">Legitimatienr. check</td>\r\n			<td style="border: 1px solid black;padding: 5px;">Abonn. Nr.</td>\r\n			<td style="border: 1px solid black;padding: 5px;">Sticker nr.</td>\r\n			<td style="border: 1px solid black;padding: 5px;">Penningnr.</td>\r\n			<td style="border: 1px solid black;padding: 5px;">Ingangsdatum</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="border: 1px solid black;padding: 5px;">&nbsp;</td>\r\n			<td style="border: 1px solid black;padding: 5px;">&nbsp;</td>\r\n			<td style="border: 1px solid black;padding: 5px;">&nbsp;</td>\r\n			<td style="border: 1px solid black;padding: 5px;">&nbsp;</td>\r\n			<td style="border: 1px solid black;padding: 5px;">&nbsp;</td>\r\n			<td style="border: 1px solid black;">&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style="font-size: 80%;"><sup>1</sup> Het is niet verplicht om dit veld in te vullen; op de kopie van de legitimatiepas mag het legitimatienummer onleesbaar gemaakt worden</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Hic et Nunc Administrator', '2017-10-11 13:57:12', 'AE7A4646-D418-A89D-E594D86096F9D9F8', '2017-10-11 15:18:51'),
	('3BE363A7-B3D9-4650-BE3CF4EF5E1373F7', 'Extra toelichting akkoord voorwaarden', '<p><span style="color: rgb(72, 72, 72); font-family: MyISAM l, helvetica, verdana; font-size: 13.2px;">Ik geef toestemming aan de Gemeente Amsterdam, GVB Amsterdam en de uitgever van de OV-chipkaart Translink om mijn persoonsgegevens te verwerken voor het kunnen gebruiken van mijn OV-chipkaart als identificatiemiddel voor mijn fietsparkeerabonnement.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0.3em 0px 1em; color: rgb(72, 72, 72); font-family: MyISAM l, helvetica, verdana; font-size: 13.2px;">Verstrekken van uw persoonsgegevens, te weten uw OV-chipkaartidentifactie, houdt in dat Translink het interne kaartnummer (chip-id) dat behoort bij het op uw kaart afgedrukte nummer (engraved-id) verstrekt. U kunt de OV-chipkaart daarna gebruiken om u te identificeren als geaccepteerde gebruiker.</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0.3em 0px 1em; color: rgb(72, 72, 72); font-family: MyISAM l, helvetica, verdana; font-size: 13.2px;">Translink verstrekt niet uw naam, adres, woonplaatsgegevens of andere gegevens die Translinkover u verwerkt. De verstrekking van de OV-chipkaartidentificatie zal door Translink worden stopgezet indien u uw abonnement be&euml;ndigt.</p>\r\n', 'Linda Heilmann', '2018-11-14 15:50:45', 'AE7A4646-D418-A89D-E594D86096F9D9F8', '2018-11-14 15:50:45'),
