n<div>Handtekening aanvrager</div>\r\n\r\n<div style="padding-top: 2cm;">___________________________</div>\r\n</div>\r\n\r\n<div style="width: 4cm;float:left;">\r\n<div>datum</div>\r\n\r\n<div style="padding-top: 2cm;">____ - ____ - 20____</div>\r\n</div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style="clear:both;margin-top: 2cm;">DIT FORMULIER INGEVULD EN ONDERTEKEND MEEBRENGEN NAAR:<br />\r\nU-Stal Holding B.V.<br />\r\nKanaalweg 50<br />\r\n3526 KM Utrecht</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>In te vullen door U-stal Holding BV:</p>\r\n\r\n<table style="border-collapse: collapse;width:100%;">\r\n	<tbody>\r\n		<tr>\r\n			<td style="border: 1px solid black;padding: 5px;">Banknr. check</td>\r\n			<td style="border: 1px solid black;padding: 5px;">Legitimatienr. check</td>\r\n			<td style="border: 1px solid black;padding: 5px;">Abonn. Nr.</td>\r\n			<td style="border: 1px solid black;padding: 5px;">Sticker nr.</td>\r\n			<td style="border: 1px solid black;padding: 5px;">Penningnr.</td>\r\n			<td style="border: 1px solid black;padding: 5px;">Ingangsdatum</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="border: 1px solid black;padding: 5px;">&nbsp;</td>\r\n			<td style="border: 1px solid black;padding: 5px;">&nbsp;</td>\r\n			<td style="border: 1px solid black;padding: 5px;">&nbsp;</td>\r\n			<td style="border: 1px solid black;padding: 5px;">&nbsp;</td>\r\n			<td style="border: 1px solid black;padding: 5px;">&nbsp;</td>\r\n			<td style="border: 1px solid black;">&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style="font-size: 80%;"><sup>1</sup> Het is niet verplicht om dit veld in te vullen; op de kopie van de legitimatiepas mag het legitimatienummer onleesbaar gemaakt worden</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Hic et Nunc Administrator', '2017-10-20 16:53:28', 'E1991A95-08EF-F11D-FF946CE1AA0578FB', '2017-10-20 16:53:28'),
	('85CE02FE-4C64-4473-9510169494630210', 'Contract buurtstalling', '<div style="font-family: MyISAM l, Helvetica, sans-serif;font-size: 9pt;">\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>Type fietsenstalling:</td>\r\n			<td>{stalling.type}</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Locatie fietsenstalling:</td>\r\n			<td>{stalling.naam}</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Abonnementsvorm:</td>\r\n			<td>{abonnement.type}</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Nummer plaats:</td>\r\n			<td>{plek.nummer}</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>In te vullen door de Beheerder:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table style="width:100%;border-collapse:collapse;">\r\n	<tbody>\r\n		<tr>\r\n			<th style="border:1px solid black;width: 50%;">Nummer Penning:</th>\r\n			<th style="border:1px solid black;width: 50%;">Nummer Sleutel:</th>\r\n		</tr>\r\n		<tr>\r\n			<td style="border:1px solid black;width: 50%;padding-top:0.5cm;">&nbsp;</td>\r\n			<td style="border:1px solid black;width: 50%;padding-top:0.5cm;">&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h1>Stallingovereenkomst Fiets</h1>\r\n\r\n<p>Ondergetekenden:<br />\r\n<br />\r\n1. Gemeente Utrecht, Sector Milieu en Mobiliteit, Afdeling Realisatie Mobiliteit, gevestigd aan de Ravellaan 96 te Utrecht, ten dezen rechtsgeldig vertegenwoordigd door het hoofd afdeling Realisatie Mobiliteit, mevrouw M. Zijp, hierna te noemen: &quot;Exploitant&quot;,<br />\r\n<br />\r\nen<br />\r\n<br />\r\n2. {account.achternaam}, {account.voornaam} {account.tussenvoegsels}<br />\r\n{account.adres}<br />\r\n{account.postcode} {account.plaats}<br />\r\n<br />\r\n<br />\r\nhierna te noemen: &quot;Staller&quot;,<br />\r\n<br />\r\nkomen een stallingovereenkomst overeen onder de volgende voorwaarden.</p>\r\n\r\n<h4>1. Definities</h4>\r\n\r\n<p>1.1 Exploitant: Gemeente Utrecht, Sector Milieu en Mobiliteit, Afdeling Realisatie Mobiliteit, Postbus 8406, 3503 RK Utrecht.</p>\r\n\r\n<p>1.2 Beheerder: de partij die in opdracht van de Exploitant voorziet in het beheer en onderhoud van de Fietsenstallingen. De Beheerder verzorgt tevens de registratie van overeenkomsten en de uitgave en inname van Sleutels en Penningen. Bij het aangaan van deze overeenkomst is de Beheerder: U-Stal Holding B.V. Adres: Kanaalweg 50, 3526 KM Utrecht.</p>\r\n\r\n<p>1.3 Staller: de eigenaar, houder of gebruiker van een (elektrische) fiets die met de Exploitant de stallingovereenkomst aangaat.</p>\r\n\r\n<p>1.4 Fietsenstalling: een buurtstalling, fietstrommel of fietskluis met bijbehorende terreinen en ruimten.</p>\r\n\r\n<p>1.5 Sleutel: sleutel waarmee de Fietsenstalling kan worden geopend en gesloten.</p>\r\n\r\n<p>1.6 Penning: metalen penning met unieke code, die onder het zadel van de fiets dient te worden bevestigd.</p>\r\n\r\n<p>1.7 Fietsendepot: Gemeentelijk opslagdepot waar onder andere verwijderde (elektrische) fietsen tijdelijk worden opgeslagen. Bij het aangaan van deze overeenkomst is het adres: Kanaalweg 50, 3526 KM Utrecht. Openingstijden van de afhaalbalie zijn: dinsdag van 13.00 - 17.00 uur, donderdag van 13.00 - 19.00 uur en zaterdag van 10.00 - 14.00 uur.</p>\r\n\r\n<h4>2. Onderwerp van de overeenkomst</h4>\r\n\r\n<p>2.1 Staller is gerechtigd om tijdens de duur van deze overeenkomst &eacute;&eacute;n (elektrische) fiets voorzien van een Penning te stallen op &eacute;&eacute;n toegewezen plaats in de Fietsenstalling genoemd op de eerste pagina van deze overeenkomst. Staller ontvangt hiervoor van Beheerder een Sleutel en een Penning. De Sleutel verschaft 24 uur per dag, 7 dagen in de week toegang tot de Fietsenstalling.</p>\r\n\r\n<h4>3. Sleutel en Penning</h4>\r\n\r\n<p>3.1 De Sleutel en Penning mogen door Staller niet worden overgedragen of onder enigerlei titel ter beschikking worden gesteld aan een derde of derden.</p>\r\n\r\n<p>3.2 Het is Staller niet toegestaan duplicaten te (laten) maken van de Sleutel en/of de Penning.</p>\r\n\r\n<p>3.3 De borgsommen voor een Sleutel en de Penning bedragen &euro; 18,85 respectievelijk &euro; 1,15 (prijspeil 2012).</p>\r\n\r\n<h4>4. Duur overeenkomst</h4>\r\n\r\n<p>4.1 De stallingovereenkomst wordt aangegaan voor onbepaalde tijd, althans met inachtneming van de hierna volgende be&euml;indigingmogelijkheden.</p>\r\n\r\n<p>4.2 De stallingovereenkomst kan door Staller schriftelijk worden be&euml;indigd met inachtneming van een opzegtermijn van ten minste 14 dagen v&oacute;&oacute;r de eerste dag van de volgende maand. De overeenkomst eindigt dan per de eerste dag van de volgende maand. Staller richt de opzeggingsbrief aan de Beheerder.</p>\r\n\r\n<p>4.3 De stallingovereenkomst eindigt van rechtswege zodra de huurovereenkomst tussen de Exploitant en de eigenaar van de Fietsenstalling wordt be&euml;indigd.</p>\r\n\r\n<p>4.4 Exploitant kan de stallingovereenkomst terstond be&euml;indigen als Staller zich niet houdt aan de bepalingen uit deze overeenkomst. De opzegging door Exploitant geschiedt schriftelijk. De brief zal worden gestuurd naar het adres dat bekend is bij de Beheerder.</p>\r\n\r\n<p>4.5 Staller dient binnen 5 werkdagen na datum van be&euml;indiging van de stallingovereenkomst de Sleutel en Penning in te leveren bij de Beheerder.</p>\r\n\r\n<p>4.6 Beheerder zal restitutie verlenen van eventueel teveel betaald abonnementsgeld alsook het borggeld retourneren, nadat de Sleutel en Penning zijn ingeleverd bij de Beheerder.</p>\r\n\r\n<p>4.7 Indien Staller verzaakt om binnen 5 werkdagen na datum van be&euml;indiging van de stallingovereenkomst de Sleutel en de Penning in te leveren bij de Beheerder, kan de Beheerder een boete opleggen van &euro; 10,- voor elke dag dat Sleutel en Penning niet zijn ingeleverd. Eventuele aanvullende kosten die Beheerder maakt om de Sleutel en Penning weer in bezit te krijgen, zullen worden verhaald op de Staller. De Beheerder kan de inning van de boete(s) overdragen aan een gerechtsdeurwaarder.</p>\r\n\r\n<h4>5. Stallinggeld en betaling</h4>\r\n\r\n<p>5.1 De hoogte van het stallinggeld en de verwijderboete (zie artikel 6.11) worden jaarlijks door het college van B&amp;W van de gemeente Utrecht vastgesteld.</p>\r\n\r\n<p>5.2 Staller dient het verschuldigde stallinggeld en de borgsommen vooraf te voldoen. Hiertoe vraagt de Beheerder de Staller, voorafgaande aan het aangaan van de stallingovereenkomst een machtiging in te vullen en te ondertekenen. De borgsommen worden eenmalig ge&iuml;ncasseerd bij aanvang van de stallingovereenkomst en het stallinggeld wordt &eacute;&eacute;n keer per jaar ge&iuml;ncasseerd door de Beheerder.</p>\r\n\r\n<h4>6. Overige rechten en verplichtingen van partijen</h4>\r\n\r\n<p>6.1 De Fietsenstalling mag alleen worden betreden door Staller en de door Exploitant en/of Beheerder aangewezen personen.</p>\r\n\r\n<p>6.2 Staller mag alleen gebruik maken van de aan hem/ haar toegewezen stallingsplaats(en).</p>\r\n\r\n<p>6.4 In de Fietsenstalling mogen geen reparatie- en/of onderhoudswerkzaamheden aan de eigen fiets en/of de inventaris worden uitgevoerd door Staller.</p>\r\n\r\n<p>6.5 Het is zonder schriftelijke toestemming van de Exploitant niet toegestaan om een accu van een elektrische fiets op te laden via een (eventueel) aanwezige wandcontactdoos.</p>\r\n\r\n<p>6.6 Staller mag de aan hem/haar beschikbaar gestelde stallingplaats niet aan derden verhuren of anderszins in gebruik geven.</p>\r\n\r\n<p>6.7 De gestalde fiets dient te allen tijde voorzien te zijn van een geldige, bij deze overeenkomst behorende Penning.</p>\r\n\r\n<p>6.8 Een fiets die zonder (zichtbaar) bevestigde geldige Penning in de Fietsenstalling is gestald en/of niet op de daartoe aangewezen stallingplaats staat, wordt gelabeld. De fiets wordt geregistreerd in een door de Beheerder beheerde database.</p>\r\n\r\n<p>6.9 Een gelabelde fiets die na 14 dagen nog niet is verwijderd uit de Fietsenstalling en/of niet is voorzien van een geldige Penning, kan zonder voorafgaande (schriftelijke) melding uit de Fietsenstalling worden verwijderd en worden afgevoerd naar het Fietsendepot.</p>\r\n\r\n<p>6.10 Een fiets die zonder (zichtbaar) bevestigde geldig(e) Penning is gestald in de Fietsenstalling &eacute;n voorkomt in de database van de Beheerder als zijnde een fiets die al eerder zonder geldige Penning is aangetroffen in de Fietsenstalling, zal zonder voorafgaande (schriftelijke) melding uit de Fietsenstalling worden verwijderd en worden afgevoerd naar het Fietsendepot.</p>\r\n\r\n<p>6.11 Verwijderde fietsen worden 14 dagen bewaard in het Fietsendepot en kunnen tegen betaling van een boete van &euro; 13,00 (prijspeil 2013) worden opgehaald bij het Fietsendepot. Fietsen die na 14 dagen niet zijn opgehaald, worden eigendom van de Exploitant.</p>\r\n\r\n<h4>7. Schade, verlies en diefstal</h4>\r\n\r\n<p>7.1 Bij verlies of diefstal van (een) Sleutel(s) of Penning(en) moet Staller dit direct aan de Beheerder kenbaar maken, alsook aangifte doen van vermissing. Staller is aansprakelijk voor de kosten die voorvloeien uit het verlies van de Sleutel(s) en/of Penning(en), zoals het aanmaken en uitreiken van een nieuwe Sleutel, Penning en eventueel het vervangen van het slot op de toegangsdeur alsook de vervanging van de sleutels van alle andere stallers.</p>\r\n\r\n<p>7.2 Exploitant en Beheerder zijn niet aansprakelijk voor schade aan en/of verlies van in de Fietsenstalling bewaarde goederen, veroorzaakt door brand, lekkage, diefstal en/of vernieling.</p>\r\n\r\n<h4>8. Overige</h4>\r\n\r\n<p>8.1 De Beheerder geldt als eerste aanspreekpunt bij vragen en/of klachten over het gebruik van de Fietsenstalling.</p>\r\n\r\n<p>8.3 Staller meldt een eventuele adreswijziging schriftelijk en binnen vijf werkdagen bij de Beheerder.</p>\r\n\r\n<p>8.2 In alle gevallen waarin deze overeenkomst niet voorziet, beslist de Exploitant met inachtneming van redelijkheid en billijkheid.</p>\r\n\r\n<p>Aldus overeengekomen en in tweevoud opgemaakt en ondertekend:</p>\r\n\r\n<div style="width:40%;float:left;">Gemeente Utrecht, Sector Milieu en Mobiliteit,<br />\r\nAfdeling Realisatie Mobiliteit<br />\r\n<img alt="" src="https://www.veiligstallen.nl/library/E1991A95-08EF-F11D-FF946CE1AA0578FB/file/handtekening.png" style="width: 268px; height: 94px; float: left;" /><br />\r\nM. Zijp Hoofd afdeling Realisatie Mobiliteit,<br />\r\nGemeente Utrecht<br />\r\nPlaats: Utrecht<br />\r\nDatum: {datum}</div>\r\n\r\n<div style="width:40%;float:right;">Staller<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\nNaam: {account.naam}<br />\r\nPlaats: Utrecht<br />\r\nDatum:</div>\r\n</div>\r\n', 'Hic et Nunc Administrator', '2016-02-25 16:27:57', 'E1991A95-08EF-F11D-FF946CE1AA0578FB', '2017-10-20 16:53:41'),
	('AFBFCF10-035C-41EB-B879D39D46E363BF', 'contract_buurtstalling', '<div style="font-family: MyISAM l, Helvetica, sans-serif;font-size: 9pt;">\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>Type fietsenstalling:</td>\r\n			<td>{stalling.type}</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Locatie fietsenstalling:</td>\r\n			<td>{stalling.naam}</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Abonnementsvorm:</td>\r\n			<td>{abonnement.type}</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Nummer plaats:</td>\r\n			<td>{plek.nummer}</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="font-size: 9pt;">In te vullen door de Beheerder:&nbsp;</span></p>\r\n&nbsp;\r\n\r\n<table style="width:100%;border-collapse:collapse;">\r\n	<tbody>\r\n		<tr>\r\n			<th style="border:1px solid black;width: 50%;">Nummer Penning:</th>\r\n			<th style="border:1px solid black;width: 50%;">Nummer Sleutel:</th>\r\n		</tr>\r\n		<tr>\r\n			<td style="border:1px solid black;width: 50%;padding-top:0.5cm;">&nbsp;</td>\r\n			<td style="border:1px solid black;width: 50%;padding-top:0.5cm;">&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h1>Stallingovereenkomst Fiets</h1>\r\n\r\n<p>Ondergetekenden:<br />\r\n<br />\r\n1. Gemeente Utrecht, Sector Milieu en Mobiliteit, Afdeling Realisatie Mobiliteit, gevestigd aan de Ravellaan 96 te Utrecht, ten dezen rechtsgeldig vertegenwoordigd door het hoofd afdeling Realisatie Mobiliteit, mevrouw M. Zijp, hierna te noemen: &quot;Exploitant&quot;,<br />\r\n<br />\r\nen<br />\r\n<br />\r\n2. {account.achternaam}, {account.voornaam} {account.tussenvoegsels}<br />\r\n{account.adres}<br />\r\n{account.postcode} {account.plaats}<br />\r\n<br />\r\n<br />\r\nhierna te noemen: &quot;Staller&quot;,<br />\r\n<br />\r\nkomen een stallingovereenkomst overeen onder de volgende voorwaarden.</p>\r\n\r\n<h4>1. Definities</h4>\r\n\r\n<p>1.1 Exploitant: Gemeente Utrecht, Sector Milieu en Mobiliteit, Afdeling Realisatie Mobiliteit, Postbus 8406, 3503 RK Utrecht.</p>\r\n\r\n<p>1.2 Beheerder: de partij die in opdracht van de Exploitant voorziet in het beheer en onderhoud van de Fietsenstallingen. De Beheerder verzorgt tevens de registratie van overeenkomsten en de uitgave en inname van Sleutels en Penningen. Bij het aangaan van deze overeenkomst is de Beheerder: U-Stal Holding B.V. Adres: Kanaalweg 50, 3526 KM Utrecht.</p>\r\n\r\n<p>1.3 Staller: de eigenaar, houder of gebruiker van een (elektrische) fiets die met de Exploitant de stallingovereenkomst aangaat.</p>\r\n\r\n<p>1.4 Fietsenstalling: een buurtstalling, fietstrommel of fietskluis met bijbehorende terreinen en ruimten.</p>\r\n\r\n<p>1.5 Sleutel: sleutel waarmee de Fietsenstalling kan worden geopend en gesloten.</p>\r\n\r\n<p>1.6 Penning: metalen penning met unieke code, die onder het zadel van de fiets dient te worden bevestigd.</p>\r\n\r\n<p>1.7 Fietsendepot: Gemeentelijk opslagdepot waar onder andere verwijderde (elektrische) fietsen tijdelijk worden opgeslagen. Bij het aangaan van deze overeenkomst is het adres: Kanaalweg 50, 3526 KM Utrecht. Openingstijden van de afhaalbalie zijn: dinsdag van 13.00 - 17.00 uur, donderdag van 13.00 - 19.00 uur en zaterdag van 10.00 - 14.00 uur.</p>\r\n\r\n<h4>2. Onderwerp van de overeenkomst</h4>\r\n\r\n<p>2.1 Staller is gerechtigd om tijdens de duur van deze overeenkomst &eacute;&eacute;n (elektrische) fiets voorzien van een Penning te stallen op &eacute;&eacute;n toegewezen plaats in de Fietsenstalling genoemd op de eerste pagina van deze overeenkomst. Staller ontvangt hiervoor van Beheerder een Sleutel en een Penning. De Sleutel verschaft 24 uur per dag, 7 dagen in de week toegang tot de Fietsenstalling.</p>\r\n\r\n<h4>3. Sleutel en Penning</h4>\r\n\r\n<p>3.1 De Sleutel en Penning mogen door Staller niet worden overgedragen of onder enigerlei titel ter beschikking worden gesteld aan een derde of derden.</p>\r\n\r\n<p>3.2 Het is Staller niet toegestaan duplicaten te (laten) maken van de Sleutel en/of de Penning.</p>\r\n\r\n<p>3.3 De borgsommen voor een Sleutel en de Penning bedragen &euro; 18,85 respectievelijk &euro; 1,15 (prijspeil 2012).</p>\r\n\r\n<h4>4. Duur overeenkomst</h4>\r\n\r\n<p>4.1 De stallingovereenkomst wordt aangegaan voor onbepaalde tijd, althans met inachtneming van de hierna volgende be&euml;indigingmogelijkheden.</p>\r\n\r\n<p>4.2 De stallingovereenkomst kan door Staller schriftelijk worden be&euml;indigd met inachtneming van een opzegtermijn van ten minste 14 dagen v&oacute;&oacute;r de eerste dag van de volgende maand. De overeenkomst eindigt dan per de eerste dag van de volgende maand. Staller richt de opzeggingsbrief aan de Beheerder.</p>\r\n\r\n<p>4.3 De stallingovereenkomst eindigt van rechtswege zodra de huurovereenkomst tussen de Exploitant en de eigenaar van de Fietsenstalling wordt be&euml;indigd.</p>\r\n\r\n<p>4.4 Exploitant kan de stallingovereenkomst terstond be&euml;indigen als Staller zich niet houdt aan de bepalingen uit deze overeenkomst. De opzegging door Exploitant geschiedt schriftelijk. De brief zal worden gestuurd naar het adres dat bekend is bij de Beheerder.</p>\r\n\r\n<p>4.5 Staller dient binnen 5 werkdagen na datum van be&euml;indiging van de stallingovereenkomst de Sleutel en Penning in te leveren bij de Beheerder.</p>\r\n\r\n<p>4.6 Beheerder zal restitutie verlenen van eventueel teveel betaald abonnementsgeld alsook het borggeld retourneren, nadat de Sleutel en Penning zijn ingeleverd bij de Beheerder.</p>\r\n\r\n<p>4.7 Indien Staller verzaakt om binnen 5 werkdagen na datum van be&euml;indiging van de stallingovereenkomst de Sleutel en de Penning in te leveren bij de Beheerder, kan de Beheerder een boete opleggen van &euro; 10,- voor elke dag dat Sleutel en Penning niet zijn ingeleverd. Eventuele aanvullende kosten die Beheerder maakt om de Sleutel en Penning weer in bezit te krijgen, zullen worden verhaald op de Staller. De Beheerder kan de inning van de boete(s) overdragen aan een gerechtsdeurwaarder.</p>\r\n\r\n<h4>5. Stallinggeld en betaling</h4>\r\n\r\n<p>5.1 De hoogte van het stallinggeld en de verwijderboete (zie artikel 6.11) worden jaarlijks door het college van B&amp;W van de gemeente Utrecht vastgesteld.</p>\r\n\r\n<p>5.2 Staller dient het verschuldigde stallinggeld en de borgsommen vooraf te voldoen. Hiertoe vraagt de Beheerder de Staller, voorafgaande aan het aangaan van de stallingovereenkomst een machtiging in te vullen en te ondertekenen. De borgsommen worden eenmalig ge&iuml;ncasseerd bij aanvang van de stallingovereenkomst en het stallinggeld wordt &eacute;&eacute;n keer per jaar ge&iuml;ncasseerd door de Beheerder.</p>\r\n\r\n<h4>6. Overige rechten en verplichtingen van partijen</h4>\r\n\r\n<p>6.1 De Fietsenstalling mag alleen worden betreden door Staller en de door Exploitant en/of Beheerder aangewezen personen.</p>\r\n\r\n<p>6.2 Staller mag alleen gebruik maken van de aan hem/ haar toegewezen stallingsplaats(en).</p>\r\n\r\n<p>6.4 In de Fietsenstalling mogen geen reparatie- en/of onderhoudswerkzaamheden aan de eigen fiets en/of de inventaris worden uitgevoerd door Staller.</p>\r\n\r\n<p>6.5 Het is zonder schriftelijke toestemming van de Exploitant niet toegestaan om een accu van een elektrische fiets op te laden via een (eventueel) aanwezige wandcontactdoos.</p>\r\n\r\n<p>6.6 Staller mag de aan hem/haar beschikbaar gestelde stallingplaats niet aan derden verhuren of anderszins in gebruik geven.</p>\r\n\r\n<p>6.7 De gestalde fiets dient te allen tijde voorzien te zijn van een geldige, bij deze overeenkomst behorende Penning.</p>\r\n\r\n<p>6.8 Een fiets die zonder (zichtbaar) bevestigde geldige Penning in de Fietsenstalling is gestald en/of niet op de daartoe aangewezen stallingplaats staat, wordt gelabeld. De fiets wordt geregistreerd in een door de Beheerder beheerde database.</p>\r\n\r\n<p>6.9 Een gelabelde fiets die na 14 dagen nog niet is verwijderd uit de Fietsenstalling en/of niet is voorzien van een geldige Penning, kan zonder voorafgaande (schriftelijke) melding uit de Fietsenstalling worden verwijderd en worden afgevoerd naar het Fietsendepot.</p>\r\n\r\n<p>6.10 Een fiets die zonder (zichtbaar) bevestigde geldig(e) Penning is gestald in de Fietsenstalling &eacute;n voorkomt in de database van de Beheerder als zijnde een fiets die al eerder zonder geldige Penning is aangetroffen in de Fietsenstalling, zal zonder voorafgaande (schriftelijke) melding uit de Fietsenstalling worden verwijderd en worden afgevoerd naar het Fietsendepot.</p>\r\n\r\n<p>6.11 Verwijderde fietsen worden 14 dagen bewaard in het Fietsendepot en kunnen tegen betaling van een boete van &euro; 13,00 (prijspeil 2013) worden opgehaald bij het Fietsendepot. Fietsen die na 14 dagen niet zijn opgehaald, worden eigendom van de Exploitant.</p>\r\n\r\n<h4>7. Schade, verlies en diefstal</h4>\r\n\r\n<p>7.1 Bij verlies of diefstal van (een) Sleutel(s) of Penning(en) moet Staller dit direct aan de Beheerder kenbaar maken, alsook aangifte doen van vermissing. Staller is aansprakelijk voor de kosten die voorvloeien uit het verlies van de Sleutel(s) en/of Penning(en), zoals het aanmaken en uitreiken van een nieuwe Sleutel, Penning en eventueel het vervangen van het slot op de toegangsdeur alsook de vervanging van de sleutels van alle andere stallers.</p>\r\n\r\n<p>7.2 Exploitant en Beheerder zijn niet aansprakelijk voor schade aan en/of verlies van in de Fietsenstalling bewaarde goederen, veroorzaakt door brand, lekkage, diefstal en/of vernieling.</p>\r\n\r\n<h4>8. Overige</h4>\r\n\r\n<p>8.1 De Beheerder geldt als eerste aanspreekpunt bij vragen en/of klachten over het gebruik van de Fietsenstalling.</p>\r\n\r\n<p>8.3 Staller meldt een eventuele adreswijziging schriftelijk en binnen vijf werkdagen bij de Beheerder.</p>\r\n\r\n<p>8.2 In alle gevallen waarin deze overeenkomst niet voorziet, beslist de Exploitant met inachtneming van redelijkheid en billijkheid.</p>\r\n\r\n<p>Aldus overeengekomen en in tweevoud opgemaakt en ondertekend:</p>\r\n\r\n<div style="width:40%;float:left;">Gemeente Utrecht, Sector Milieu en Mobiliteit,<br />\r\nAfdeling Realisatie Mobiliteit<br />\r\n<img alt="" src="https://www.veiligstallen2.nl/library/AE7A4646-D418-A89D-E594D86096F9D9F8/file/handtekening.png" style="width: 268px; height: 94px; float: left;" /><br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\nM. Zijp Hoofd afdeling Realisatie Mobiliteit,<br />\r\nGemeente Utrecht<br />\r\nPlaats: Utrecht<br />\r\nDatum:</div>\r\n\r\n<div style="width:40%;float:right;">Staller<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\nNaam: {account.naam}<br />\r\nPlaats: Utrecht<br />\r\nDatum:</div>\r\n</div>\r\n', 'Exploitant A', '2016-02-25 16:21:17', 'AE7A4646-D418-A89D-E594D86096F9D9F8', '2018-11-14 15:34:35'),
	('C87E69C1-7C7D-45F3-AF43E98CFB401267', 'contract buurtstalling zakelijk', '<p>CONTRACT ZAKELIJK</p>\r\n\r\n<p>{account.naam}</p>\r\n\r\n<p>{plek.nummer}</p>\r\n\r\n<p>{datum}</p>\r\n', 'Hic et Nunc Administrator', '2017-10-10 15:50:14', 'AE7A4646-D418-A89D-E594D86096F9D9F8', '2017-10-10 15:50:14'),
	('CB271106-84C2-4176-96B26D6BADC2DB37', 'Abonnementsvoorwaarden', '<p>Paar A4-tjes met abonnementsvoorwaarden.</p>\r\n', 'Linda Heilmann', '2018-11-14 15:59:23', 'E197BE8A-A7A7-8C78-3EF005803C8F1E29', '2018-11-14 15:59:23'),
	('CE5FAF61-42DE-41A5-B453822380E1C037', 'Extra toelichting akkoord voorwaarden', '<p style="box-sizing: border-box; margin: 0.3em 0px 1em; color: rgb(72, 72, 72); font-family: MyISAM l, helvetica, verdana; font-size: 13.2px;">Ik geef toestemming aan de Gemeente Amsterdam, GVB Amsterdam en de uitgever van de OV-chipkaart Translink om mijn persoonsgegevens te verwerken voor het kunnen gebruiken van mijn OV-chipkaart als identificatiemiddel voor mijn fietsparkeerabonnement.</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0.3em 0px 1em; color: rgb(72, 72, 72); font-family: MyISAM l, helvetica, verdana; font-size: 13.2px;">Verstrekken van uw persoonsgegevens, te weten uw OV-chipkaartidentifactie, houdt in dat Translink het interne kaartnummer (chip-id) dat behoort bij het op uw kaart afgedrukte nummer (engraved-id) verstrekt. U kunt de OV-chipkaart daarna gebruiken om u te identificeren als geaccepteerde gebruiker.</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0.3em 0px 1em; color: rgb(72, 72, 72); font-family: MyISAM l, helvetica, verdana; font-size: 13.2px;">Translink verstrekt niet uw naam, adres, woonplaatsgegevens of andere gegevens die Translinkover u verwerkt. De verstrekking van de OV-chipkaartidentificatie zal door Translink worden stopgezet indien u uw abonnement be&euml;ndigt.</p>\r\n', 'Linda Heilmann', '2018-11-14 15:51:55', 'E197BE8A-A7A7-8C78-3EF005803C8F1E29', '2018-11-14 15:51:55'),
	('E5BB20FA-2B11-45F2-887BC054842DB24B', 'Standaardcontract', '<p>Hierbij verklaar ik, {account.naam}, dat ik 100.000 euro verschuldigd ben aan CROW</p>\r\n\r\n<p>{account.plaats}, {datum}</p>\r\n', 'Hic et Nunc Administrator', '2018-12-03 09:33:23', '1', '2018-12-03 09:33:23'),
