REPLACE INTO `mailings_standaardteksten` (`ID`, `SiteID`, `Title`, `Article`, `Status`, `EditorCreated`, `DateCreated`, `EditorModified`, `DateModified`) VALUES
	('B98BBEBF-C321-ED6B-C4196CD3B8187514', 'E197BB1B-AAE9-44DD-6C11BA303AE4782D', 'test', '<p>tes&nbsp;</p>', '1', 'Linda Heilmann', '2014-09-25 11:32:37', 'Linda Heilmann', '2014-09-25 11:32:37'),
	('D414122B-EBBD-CCC3-A06AC5C01C5070A0', '863AA4F7-E6A7-236D-BFAAD9D80A54ADE6', 'Uw Fiets-en-Win pas ontbreekt', '<p>Geachte heer/mevrouw,<br />\r\n<br />\r\nU heeft zich aangemeld als deelnemer aan Fiets-en-Win Apeldoorn. Bij een controle van uw gegevens is gebleken dat uw registratie niet compleet is. Uw pasnummer ontbreekt. Om mee te dingen naar de prijzen van Fiets en Win Apeldoorn dient u minimaal &eacute;&eacute;n pas toe te voegen aan uw persoonlijke Fiets en Win account. Deze pas is een sleutelhanger en heeft u in &eacute;&eacute;n v/d fietsenstallingen in Apeldoorn ontvangen. Indien dit niet het geval is, krijgt u deze uitgereikt wanneer u in &eacute;&eacute;n van de deelnemende stallingen in Apeldoorn uw fiets stalt.</p>\r\n<p>Met de link onderaan deze mail heeft u rechtstreeks toegang tot uw persoonlijke account. U krijgt het volgende scherm.</p>\r\n<p></p>\r\n<p><img border="1" alt="" width="581" height="290" src="http://www.fiets-en-win.nl/library/863AA4F7-E6A7-236D-BFAAD9D80A54ADE6/image/geenpasapeldoorn_def.jpg" /></p>\r\n<p>Nadat u&nbsp;klikt op <u>klik hier om uw gegevens te beheren </u>komt u direct bij het formulier om uw pas toe te voegen. Het<strong> pasnummer </strong>staat onder de streepjescode op uw pas. Zie de foto hieronder, n.b. de nummers onder de streepjescode zijn onscherp gemaakt.</p>\r\n<p style="text-align: center"><img border="1" alt="" width="419" height="134" src="http://www.fietsenwin.nl/library/863AA4F7-E6A7-236D-BFAAD9D80A54ADE6/image/fietspassen_apeldoorn_barco.jpg" /></p>\r\n<p>Het pasnummer begint altijd met 73 en bestaat in totaal uit 12 cijfers. Vervolgens bent u vrij om een omschrijving toe te voegen aan uw pas. Bijvoorbeeld:&nbsp;&lsquo;mijn rode fiets&rsquo;.</p>\r\n<p>We wensen u veel succes met de komende trekkingen van Fiets-en-Win!</p>\r\n<p>Namens de Helpdesk Fiets-en-Win Apeldoorn,<br />\r\nMet vriendelijke groet, <br />\r\nNico Pierik</p>', '1', 'Hic et Nunc Administrator', '2010-10-22 15:15:55', 'Lilian Cornelisse', '2012-09-27 14:18:06'),
	('E897481B-C0DF-1C2B-3F44D3DE571F7A05', 'AE7A4646-D418-A89D-E594D86096F9D9F8', 'Uw Fiets-en-Win pas ontbreekt test', '<p>Geachte heer/mevrouw,<br />\r\n<br />\r\nU heeft zich aangemeld als deelnemer aan Fiets-en-Win Apeldoorn. Bij een controle van uw gegevens is gebleken dat uw registratie niet compleet is. Uw pasnummer ontbreekt. Om mee te dingen naar de prijzen van Fiets en Win Apeldoorn dient u minimaal &eacute;&eacute;n pas toe te voegen aan uw persoonlijke Fiets en Win account. Deze pas is een sleutelhanger en heeft u in &eacute;&eacute;n v/d fietsenstallingen in Apeldoorn ontvangen. Indien dit niet het geval is, krijgt u deze uitgereikt wanneer u in &eacute;&eacute;n van de deelnemende stallingen in Apeldoorn uw fiets stalt.</p>\r\n<p>Met de link onderaan deze mail heeft u rechtstreeks toegang tot uw persoonlijke account. U krijgt het volgende scherm.</p>\r\n<p></p>\r\n<p><img border="1" alt="" width="581" height="290" src="http://www.fiets-en-win.nl/library/863AA4F7-E6A7-236D-BFAAD9D80A54ADE6/image/geenpasapeldoorn_def.jpg" /></p>\r\n<p>Nadat u&nbsp;klikt op <u>klik hier om uw gegevens te beheren </u>komt u direct bij het formulier om uw pas toe te voegen. Het<strong> pasnummer </strong>staat direct onder de streepjescode op uw pas. Zie de foto hieronder, n.b. de nummers onder de streepjescode zijn onscherp gemaakt.</p>\r\n<p style="text-align: center"><img border="1" alt="" width="419" height="134" src="http://www.fietsenwin.nl/library/863AA4F7-E6A7-236D-BFAAD9D80A54ADE6/image/fietspassen_apeldoorn_barco.jpg" /></p>\r\n<p>Het pasnummer begint altijd met 73 en bestaat in totaal uit 12 cijfers. Vervolgens bent u vrij om een omschrijving toe te voegen aan uw pas. Bijvoorbeeld:&nbsp;&lsquo;mijn rode fiets&rsquo;.</p>\r\n<p>We wensen u veel succes met de komende trekkingen van Fiets en Win!</p>\r\n<p>Namens de Helpdesk Fiets en Win Apeldoorn,<br />\r\nMet vriendelijke groet, <br />\r\nNico Pierik</p>', '1', 'Nico Pierik', '2010-10-26 14:51:28', 'Nico Pierik', '2011-03-02 15:56:20');
