	('8EB80745-ECA6-5C1C-4E5E7E43CB8B758C', 'E1991A95-08EF-F11D-FF946CE1AA0578FB', 'Article', 'Diashow (1)', '<p>De diashow is standaard beschikbaar op stallingsniveau en op gemeenteniveau.&nbsp;<span style="line-height: 1.6;">U heeft alleen een beeldscherm met internetverbinding nodig&nbsp;</span><span style="line-height: 1.6;">(als het beeld niet past kunt u schalen met CTRL-min en CTRL-plus)</span></p>', 3, '', '', 1, '1', 'Linda Heilmann', '2015-03-02 16:20:06', 'Hic et Nunc Administrator', '2015-08-05 07:49:47'),
