REPLACE INTO `testimonials` (`ID`, `SiteID`, `Name`, `Sex`, `Abstract`, `Article`, `SortOrder`, `ShowOnHomepage`, `Status`, `EditorCreated`, `DateCreated`, `EditorModified`, `DateModified`) VALUES
	('5068F812-A79B-815B-C2CED5BB947DC89C', '4318954E-BCC6-0090-042EB2C807F1BBC1', 'Henk', 'Man', 'Nu zie ik dat ik veel woede heb opgestapeld, en heb ik geleerd om hier eerder eerlijk over te zijn. Op deze manier blijf ik rustiger en loopt de spanning in mijn leven ook niet meer zo op. De woede aanvallen heb ik niet meer.', '<p>Niemand begreep dat ik een cursus voor agressie nodig had: Je bent altijd zo&rsquo;n lieve jongen! zeiden ze. Maar af en toe kon ik zo boos worden. Nu zie ik dat ik veel woede heb opgestapeld, en heb ik geleerd om hier eerder eerlijk over te zijn. Op deze manier blijf ik rustiger en loopt de spanning in mijn leven ook niet meer zo op. De woede aanvallen heb ik niet meer.</p>', 99, '0', '1', 'Ilse  Crooy', '2010-01-21 11:24:23', 'Hic et Nunc  Administrator', '2010-01-22 11:21:46'),
	('BAD734E6-E9B4-6652-EBBF4E8C0E86FB20', '4318954E-BCC6-0090-042EB2C807F1BBC1', 'Richard', 'Man', 'Ik ga nu rustiger met situaties om, ik kan nog wel mezelf zijn, maar hoef geen ruzie meer met anderen te maken.', '<p>Mensen zeiden wel eens tegen mij dat ik &ldquo;een kort lontje&rdquo; was. Ik zeg namelijk gelijk wat ik ergens van vind, en ik laat niet met me sollen. Door te werken aan mijn agressie  kan ik zien dat dit geen slechte eigenschap is, maar dat je wel rekening moet houden met anderen. Ik heb ook gezien dat je niet direct boos hoeft te worden of in de aanval te gaan, wanneer je denkt dat je gelijk hebt. Ik ga nu rustiger met situaties om, ik kan nog wel mezelf zijn, maar hoef geen ruzie meer met anderen te maken.</p>', 1, '0', '1', 'Hic et Nunc  Administrator', '2009-12-23 10:21:32', 'Hic et Nunc  Administrator', '2010-01-22 11:20:49'),
	('BADDD5E5-F8D7-1D00-7E4CA9F162AB6682', '4318954E-BCC6-0090-042EB2C807F1BBC1', 'Sylvia', 'Vrouw', 'Nu ben ik rustiger; ik heb geleerd om spanning niet hoog op te laten lopen, maar vooral de time-out vond ik nuttig.', '<p>Ik kon me erg herkennen in het voorbeeld met de fles. Soms heb je zoveel te verstouwen: hard gewerkt, vroeg opgestaan, en dan kom je thuis en lijkt niemand het te waarderen. Dat maakt me razend. Als er dan ook maar iets gebeurde smeet ik een kopje tegen de muur. Nu ben ik rustiger; ik heb geleerd om spanning niet hoog op te laten lopen, maar vooral de &rdquo;time-out&rdquo; vond ik nuttig. Even een moment voor jezelf cree&euml;ren, zodat je weer tot rust kan komen. Mijn man begrijpt me nu ook beter, en laat me soms even met rust. Hierdoor hebben we weer oog voor elkaar gekregen.</p>', 99, '0', '1', 'Hic et Nunc  Administrator', '2009-12-23 10:28:45', 'Hic et Nunc  Administrator', '2010-01-22 11:21:08');
